window.bookSummaryJSON = "<p><b>Everyone Knows Humans Get Transported to Other Worlds, But Now Dogs Do Too?!</b></p> <p>Takumi is a wage slave who works overtime all the time. Only his little Maltese, Leo, can brighten his day. One day, however, he wakes up to find himself deep in an unknown forest. At his side is his pampered pup…who’s now a giant mythical wolf!</p> <p>With his silver fenrir companion and his mysterious new “Herb Cultivation” power, he’ll finally have the laid-back life he’s always dreamed of.</p> <p>Join Takumi and his giant fluffy hound in a carefree romp through this other world fantasy tale!</p>"; 
